Fvc='DecoratorPanel',Lxc='DefaultCalendarView',Mxc='DefaultCalendarView$CellGrid',Nxc='DefaultCalendarView$CellGrid$DateCell',tAc='DefaultComboBoxModel',Ssc='DefaultDateTimeFormatInfo',Oxc='DefaultMonthSelector',Pxc='DefaultMonthSelector$1',Qxc='DefaultMonthSelector$2',Vxc='DefaultSelectionEventManager',Wxc='DefaultSelectionEventManager$SelectAction',Yxc='DefaultSelectionEventManager$SelectAction;',Fzc='DefaultUnitConverter',Gzc='DelayedRunnable',Hzc='DelayedRunnable$1',Mdc='Deutsch',Svc='DialogBox',Yvc='DialogBox$1',Wvc='DialogBox$CaptionImpl',Xvc='DialogBox$MouseHandler',xpc="Die Wettbewerbskommission der Schweiz (Weko) nimmt Kooperationsvereinbarungen zwischen dem f\xFChrenden Telekommunikationsunternehmen Swisscom und \xF6rtlichen Stromversorgern beim Bau von Glasfasernetzen unter die Lupe. Die Swisscom hatte Mitte 2009 angek\xFCndigt, in Ballungsr\xE4umen mit Fibre-to-the-Home (FTTH) k\xFCnftig voll auf Glasfaser zu setzen. Bis 2015 will der Konzern die St\xE4dte Z\xFCrich, Genf, Basel, St. Gallen, Bern, Lausanne und den Kanton Freiburg fl\xE4chendeckend mit FTTH versorgen. Dabei setzt die Swisscom nicht nur auf selbst installierte Glasfaserinfrastrukturen, sondern das Unternehmen will nach M\xF6glichkeit auch Infrastrukturen nutzen, die bereits von \xF6rtlichen Elektrizit\xE4tsversorgern aufgebaut wurden, die den Ausbau eigener Glasfasernetze zuletzt stark vorangetrieben hatten. Und dies ist Wettbewerbern ein Dorn im Auge. So reichte etwa der Verband der Kabelnetzbetreiber, Swisscable, im Mai 2010 Beschwerde bei der Weko wegen eines Kooperationsvertrages zwischen der Stadt St. Gallen und Swisscom ein. Der Vorwurf: Marktmissbrauch. Weko-Angaben zufolge gingen in den vergangenen Monaten noch weitere Meldungen zu Kooperationen zwischen Elektrizit\xE4tsversorgern und der Swisscom bei der Wettbewerbsbeh\xF6rde ein. Als erste Stadt habe St. Gallen einzelne Klauseln ihres Kooperationsvertrages im Rahmen eines Widerspruchsverfahrens zur \xDCberpr\xFCfung gemeldet, weshalb diese Kooperation auch als erste beurteilt werde. Bei diesen Vertragsklauseln sehe die Weko teilweise 'wettbewerbsrechtliche Probleme', weshalb sie jetzt eine Vorabkl\xE4rung er\xF6ffnet habe. Die ausgehandelten Vertragsklauseln, so die Weko, 'k\xF6nnten gem\xE4\xDF einer ersten Einsch\xE4tzung den Wettbewerb nachhaltig beschr\xE4nken und langfristig zu einer Monopolisierung der Glasfasernetzinfrastruktur f\xFChren'. Ins Visier nehmen die Wettbewerbsh\xFCter auch die geplante Gr\xFCndung eines Gemeinschaftsunternehmens zwischen der Swisscom und dem Energieversorger Groupe E zum Aufbau und Betrieb einer gemeinsamen Glasfaserinfrastruktur im Kanton Freiburg. Hier best\xFCnden Anhaltspunkte, dass das Gemeinschaftsunternehmen 'eine marktbeherrschende Stellung begr\xFCndet oder verst\xE4rkt'. (pmz) ",Jzc='Dimension',Dlc='Dimension [height=',Zvc='DirectionalTextHelper',awc='DockLayoutPanel',bwc='DockLayoutPanel$Direction',cwc='DockLayoutPanel$Direction;',fwc='DockLayoutPanel$DockAnimateCommand',dwc='DockLayoutPanel$LayoutData',esc='DomEvent',jsc='DomEvent$Type',ryc='Double',jic='EAST',rcc='EEE, d MMM yyyy HH:mm:ss Z',uoc='EEE. dd MMM. yyyy HH:mm:ss',Lcc='EEEE, MMMM d',ucc='EEEE, MMMM d, y',Y9b='EM',Nfc='EMPTY',Sfc='ENABLED',Ydc='END',$9b='EX',Duc='ElementMapperImpl',Euc='ElementMapperImpl$FreeNode',Ndc='English',rrc='Enum',Edc='Etc/GMT',Gdc='Etc/GMT+',Fdc='Etc/GMT-',nac='Event type',xxc='Event$NativePreviewEvent',wsc='EventBus',Iqc='EventObject',Nqc='Exception',Qgc='Expecting version 6 from server, got ',ibc='F',Fmc='F8834F07517EF3B7D02B9E845E5E1B88',T9b='FIXED',mhc='FLOAT',nmc='Fail: ',Cbc='Feb',qbc='February',syc='Float',gwc='FlowPanel',Hvc='FocusWidget',Fkc='For input string: "',ecc='Fri',Zbc='Friday',Bac='GET',Loc='GGD55XLBAH',oqc='GGD55XLBAK',Hpc='GGD55XLBBI',Znc='GGD55XLBBJ',Koc='GGD55XLBCH',Jpc='GGD55XLBCI',mqc='GGD55XLBCK',ofc='GGD55XLBDB',Joc='GGD55XLBDH',poc='GGD55XLBDJ',Qec='GGD55XLBEB',Hoc='GGD55XLBEH',Ipc='GGD55XLBEI',pfc='GGD55XLBFB',Ooc='GGD55XLBFH',Xp
